  _push(`</div><p>In the example above, we haven&#39;t told the <code>ConstraintLayout</code> where the children should be positioned, so both <code>TextView</code>s are positioned in top left corner by default (that&#39;s why we can&#39;t see the first <code>TextView</code>; it&#39;s behind the second <code>TextView</code>!).</p><p>To tell the <code>ConstraintLayout</code> where a child should be positioned horizontally, we can add one of the following attributes (known as a <em>constraint</em>) to the child:</p><ul><li><code>app:layout_constraintLeft_toLeftOf</code></li><li><code>app:layout_constraintLeft_toRightOf</code></li><li><code>app:layout_constraintRight_toLeftOf</code></li><li><code>app:layout_constraintRight_toRightOf</code></li></ul><p>The value can either be <code>parent</code>, or the id of one of the other child <code>View</code>s in the <code>ConstraintLayout</code>.</p><p>Similarly, to tell the <code>ConstraintLayout</code> where a child should be positioned vertically, we can add one of the following attributes to the child:</p><ul><li><code>app:layout_constraintTop_toTopOf</code></li><li><code>app:layout_constraintTop_toBottomOf</code></li><li><code>app:layout_constraintBottom_toTopOf</code></li><li><code>app:layout_constraintBottom_toBottomOf</code></li></ul><p>The value can either be <code>parent</code>, or the id of one of the other child <code>View</code>s in the <code>ConstraintLayout</code>.</p><div class="custom-container tip"><p class="custom-container-title">Supporting Right-to-Left devices</p><p>To support layouts for people reading from right to left, use <code>Start</code> instead of <code>Left</code> and <code>End</code> instead of <code>Right</code> in the attribute names, e.g. use <code>layout_constraintStart_toEndOf</code> instead of <code>layout_constraintLeft_toRightOf</code>.</p></div><div class="custom-container tip"><p class="custom-container-title">Example</p><p>Example showing how to position one <code>View</code> in the top right corner, and another <code>View</code> in the bottom left corner.</p>`)
